import React from 'react';
import ReactDOM from 'react-dom';
import { Provider} from 'react-redux';
import { createStore } from "redux";
import Main from './components/Main';
ReactDOM.render(
    <Provider>
        <Main />
    </Provider>,
    document.getElementById('root')
);
